JavaScript is essential to companies using `Node.js`. It's THE language of year 2016. However, it is also a fragile language could be easily abused.

<!-- more -->
## Road toward clean code (less bug)

## `Function.prototype.call`

 `slice`   `call` 

> To convert an array-like object to an array, use Array#slice.

``` javascript
function trigger() {
   var args = Array.prototype.slice.call(arguments);
   ...
}
```

## `arguments` property

 `trigger`  `arguments`

> The arguments object is an Array-like object corresponding to the arguments passed to a function.

``` javascript
function test () {
  console.log(arguments);
}

test(); // {}
test(1,2,3);  // { '0': 1, '1': 2, '2': 3 }
test([1,2,3]); // { '0': [ 1, 2, 3 ] }
test({0:1, 1:1}); // { '0': { '0': 1, '1': 1 } }
```

  `function`   `argument`   0,1,2,3,...  index  ``

  `call` 

> The call() method calls a function with a given this value and arguments provided individually.

``` javascript
fun.call(thisArg[, arg1[, arg2[, ...]]])
```

`call` 

 call  thisArg  .bind(this)  call  `this` 

 `call` 

1  constructor,  java  `super()`  `this` bind  `call` 

``` javascript
function Product(name, price) {
  this.name = name;
  this.price = price;

  if (price < 0) {
    throw RangeError('Cannot create product ' +
                      this.name + ' with a negative price');
  }

  return this;
}

function Food(name, price) {
  Product.call(this, name, price);
  this.category = 'food';
}

Food.prototype = Object.create(Product.prototype);

function Toy(name, price) {
  Product.call(this, name, price);
  this.category = 'toy';
}

Toy.prototype = Object.create(Product.prototype);

var cheese = new Food('feta', 5);
var fun = new Toy('robot', 40);
```

2   context bind  animals  print 

``` javascript
var animals = [
  { species: 'Lion', name: 'King' },
  { species: 'Whale', name: 'Fail' }
];

for (var i = 0; i < animals.length; i++) {
  (function(i) {
    this.print = function() {
      console.log('#' + i + ' ' + this.species // 'this' is animals[i] out side
                  + ': ' + this.name);
    }
    this.print();
  }).call(animals[i], i);
}
```

3 Convert Array like Object to Array

``` javascript
function trigger() {
  var args = Array.prototype.slice.call(arguments);
  // bind arguments to this, and passes no argument to 'slice' method
  ...
}
```

